(8, 17, 17, '2024-09-10T16:00:00.000Z', '{\"name\": \"CHARISSE RAMISO\", \"branch\": \"SMCT Group of Companies Inc\", \"position\": \"HR Manager\"}', '<p><br></p><p>The issue where the loading state doesn\'t stop might occur if the code fails to exit the try block, or there could be an issue with the setApproveLoading(false) not being called due to an error. To help you troubleshoot this, here are some steps:</p><h3>Suggestions to fix the loading issue:</h3><ol><li><strong>Check if setApproveLoading(false) is called properly</strong>: Ensure that the loading state is stopped in <strong>both</strong> the success and error cases. It seems like you have already done this, but here’s a refined approach:</li><li><strong>Use finally block</strong>: You can move setApproveLoading(false) into a finally block so it runs whether the request is successful or throws an error.</li><li><strong>Check for async errors</strong>: Make sure no errors are being thrown that could prevent the code from reaching setApproveLoading(false).</li></ol><p>Here’s the updated code:</p><pre class=\"ql-syntax\" spellcheck=\"false\">tsx\n\nCopy code\nconst handleApprove = async () =&gt; {\n  const userId = localStorage.getItem(\"id\") ?? \"\";\n  const token = localStorage.getItem(\"token\");\n\n  if (!token) {\n    setErrorMessage(\"Token is missing\");\n    return;\n  }\n\n  setApproveLoading(true); // Start loading state\n\n  const requestData = {\n    user_id: Number(userId),\n    action: \"approve\",\n  };\n\n  try {\n    const apiUrl =\n      userRole === \"BranchHead\"\n        ? `http://localhost:8000/api/explain/${record.id}/process`\n        : `http://localhost:8000/api/memo/${record.id}/process`;\n\n    const response = await axios.post(apiUrl, requestData, {\n      headers: { Authorization: `Bearer ${token}` },\n    });\n\n    console.log(response);\n\n    setTimeout(() =&gt; {\n      setModalStatus(\"approved\");\n      setShowSuccessModal(true);\n      refreshData();\n    }, 1000); // Wait for 1 second before showing success\n  } catch (error: any) {\n    const errorMessage =\n      error.response?.data?.message ||\n      error.message ||\n      \"Failed to update stock requisition.\";\n    console.error(\"Error approving request form:\", errorMessage);\n    setErrorMessage(errorMessage);\n  } finally {\n    // Ensure loading state is cleared whether it\'s success or failure\n    setApproveLoading(false);\n  }\n};\n</pre><h3>Explanation:</h3><ul><li><strong>finally block</strong>: Ensures setApproveLoading(false) is called no matter if the request succeeds or fails, which will prevent the loading spinner from hanging indefinitely.</li><li><strong>setTimeout</strong>: If you want to delay the success modal for UX purposes, this should work fine as it doesn\'t interfere with setApproveLoading(false). Just ensure that setTimeout doesn\'t block other operations.</li></ul><p>By using finally, you\'ll guarantee that the loading state is reset after the request, regardless of the outcome.</p>', '[31]', '4', 'Received', '2024-09-11 08:48:42', '2024-09-13 02:03:02'),
(7, 17, 16, '2024-09-10T16:00:00.000Z', '{\"name\": \"CHARISSE RAMISO\", \"branch\": \"SMCT Group of Companies Inc\", \"position\": \"HR Manager\"}', '<p class=\"ql-align-justify\">I am writing this letter in response to the warning I received on [Date of Warning] regarding [specific issue, e.g., tardiness, failure to meet deadlines, inappropriate behavior]. I would like to offer an explanation for the circumstances that led to this situation.</p><h3 class=\"ql-align-justify\"><strong>Explanation</strong>:</h3><p class=\"ql-align-justify\">On [Date(s)], I acknowledge that the following occurred: [Provide a clear description of the incident]. The reasons behind my behavior/performance were as follows:</p><ul><li class=\"ql-align-justify\">[Explain your side, e.g., personal challenges, miscommunication, misunderstanding of expectations, health issues, etc.]</li></ul><p class=\"ql-align-justify\">I understand that these reasons do not excuse my actions, but I hope this explanation provides context for the situation. Moving forward, I am committed to improving in the following ways:</p><ul><li class=\"ql-align-justify\">[List specific steps you plan to take to prevent recurrence, e.g., managing time better, seeking clarification when needed, improving communication, etc.]</li></ul><p class=\"ql-align-justify\">I sincerely apologize for any inconvenience or disruption this may have caused, and I appreciate your understanding. I am committed to working hard and making the necessary adjustments to meet company expectations.</p><p class=\"ql-align-justify\">Please feel free to reach out if there are any further concerns or if additional clarification is needed.</p>', '[31]', '4', 'Ongoing', '2024-09-11 08:06:27', '2024-09-11 08:32:26'),
(9, 17, 19, '2024-09-12T16:00:00.000Z', '{\"name\": \"CHARISSE RAMISO\", \"branch\": \"SMCT Group of Companies Inc\", \"position\": \"HR Manager\"}', '<p>Here\'s an example of a geneasdasdasdasdric warning message:</p><p><strong>asdasdasdasd</strong>abouasdasdt to overwrite existing data. This action cannot be undone. Please ensure you have reviewed all changes before proceeding.</p><p>Would you like more context or a specific type of warning?</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>4o</p>', '[31]', '4', 'Received', '2024-09-13 01:50:29', '2024-09-13 01:57:11'),
