INSERT INTO `memos` (`id`, `user_id`, `to`, `from`, `re`, `memo_body`, `by`, `approved_by`, `status`, `created_at`, `updated_at`, `date`) VALUES
(16, 4, 17, 'HR Department', 'Warning', '<p class=\"ql-align-justify\">This letter serves as a formal written warning regarding your recent behavior and performance at [Company Name]. After reviewing your conduct and work performance, we have identified specific issues that require immediate attention.</p><h3 class=\"ql-align-justify\"><strong>Reason for Warning</strong>:</h3><p class=\"ql-align-justify\">On [Date(s)], the following issues were observed:</p><ul><li class=\"ql-align-justify\">[Clearly describe the issue(s), e.g., consistent tardiness, failure to meet deadlines, inappropriate conduct, etc.]</li></ul><h3 class=\"ql-align-justify\"><strong>Details of the Incident(s)</strong>:</h3><ul><li class=\"ql-align-justify\"><strong>Incident 1</strong>: [Provide specific details of the event, including dates, times, and any relevant witnesses]</li><li class=\"ql-align-justify\"><strong>Incident 2</strong>: [Provide additional details, if applicable]</li></ul><p class=\"ql-align-justify\">These actions are in violation of the company\'s policies, specifically [Policy Name/Section/Rule]. We have previously discussed this matter with you on [Date of previous warning, if applicable], but no significant improvement has been noted.</p><h3 class=\"ql-align-justify\"><strong>Expected Improvement</strong>:</h3><p class=\"ql-align-justify\">To avoid further disciplinary action, you are required to:</p><ul><li class=\"ql-align-justify\">[List specific actions to improve behavior or performance, e.g., arrive on time, complete assignments by deadlines, refrain from inappropriate behavior]</li><li class=\"ql-align-justify\">Adhere strictly to the company\'s policies moving forward.</li></ul><p class=\"ql-align-justify\">Failure to address these issues satisfactorily may result in further disciplinary action, up to and including termination of employment.</p><p class=\"ql-align-justify\">Please consider this your final warning. We are available to provide guidance and support to help you meet these expectations. Feel free to discuss any concerns or challenges with your supervisor or HR.</p>', '[2]', '[3]', 'Received', '2024-09-11 08:04:38', '2024-09-11 08:05:55', '2024-09-10T16:00:00.000Z'),
(17, 4, 17, 'HR Department', 'Warning', '<p>&nbsp;const handleApprove = async () =&gt; {</p><p>&nbsp; &nbsp; const userId = localStorage.getItem(\"id\") ?? \"\";</p><p>&nbsp; &nbsp; const token = localStorage.getItem(\"token\");</p><p><br></p><p>&nbsp; &nbsp; if (!token) {</p><p>&nbsp; &nbsp; &nbsp; setErrorMessage(\"Token is missing\");</p><p>&nbsp; &nbsp; &nbsp; return;</p><p>&nbsp; &nbsp; }</p><p><br></p><p>&nbsp; &nbsp; setApproveLoading(true); // Start loading state</p><p><br></p><p>&nbsp; &nbsp; const requestData = {</p><p>&nbsp; &nbsp; &nbsp; user_id: Number(userId),</p><p>&nbsp; &nbsp; &nbsp; action: \"approve\",</p><p>&nbsp; &nbsp; };</p><p><br></p><p>&nbsp; &nbsp; try {</p><p>&nbsp; &nbsp; &nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; </p><p>&nbsp; &nbsp; &nbsp;</p><p><br></p><p>&nbsp; &nbsp; &nbsp; const response = await axios.post(`http://localhost:8000/api/explain/${record.id}/process`, requestData, {</p><p>&nbsp; &nbsp; &nbsp; &nbsp; headers: { Authorization: `Bearer ${token}` },</p><p>&nbsp; &nbsp; &nbsp; });</p><p><br></p><p>&nbsp; &nbsp; &nbsp; console.log(response);</p><p><br></p><p>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; setModalStatus(\"approved\");</p><p>&nbsp; &nbsp; &nbsp; &nbsp; setShowSuccessModal(true);</p><p>&nbsp; &nbsp; &nbsp; &nbsp; refreshData();</p><p>&nbsp;</p><p>&nbsp; &nbsp; } catch (error: any) {</p><p>&nbsp; &nbsp; &nbsp; const errorMessage =</p><p>&nbsp; &nbsp; &nbsp; &nbsp; error.response?.data?.message ||</p><p>&nbsp; &nbsp; &nbsp; &nbsp; error.message ||</p><p>&nbsp; &nbsp; &nbsp; &nbsp; \"Failed to update stock requisition.\";</p><p>&nbsp; &nbsp; &nbsp; console.error(\"Error approving request form:\", errorMessage);</p><p>&nbsp; &nbsp; &nbsp; setErrorMessage(errorMessage);</p><p>&nbsp; &nbsp; } finally {</p><p>&nbsp; &nbsp; &nbsp; // Ensure loading state is cleared whether it\'s success or failure</p><p>&nbsp; &nbsp; &nbsp; setApproveLoading(false);</p><p>&nbsp; &nbsp; }</p><p>&nbsp; };</p>', '[2]', '[3]', 'Received', '2024-09-11 08:35:36', '2024-09-11 08:48:02', '2024-09-10T16:00:00.000Z'),
