(19, 4, 17, 'HR Department', 'Warning', '<p>Here\'s an example of a generic warning message:</p><p><strong>Warning:</strong> You are about to overwrite existing data. This action cannot be undone. Please ensure you have reviewed all changes before proceeding.</p><p>Would you like more context or a specific type of warning?</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>4o</p>', '[2]', '[3]', 'Received', '2024-09-13 01:48:57', '2024-09-13 01:50:03', '2024-09-12T16:00:00.000Z'),
